scriptlet.script:
try {
	var variables = variables.split("|");
	setGlobal(variables);
	scriptletResponse="success";
}
catch(error) {
	scriptletResponse="failure";
	scriptletContext.put("FailureMessage",error);
}

function setGlobal(names) {
	names.forEach(function(name) {
		var value = scriptletContext.get(name);	
		var variable = "${" + name + "}";	
		if( value !== null && value !== undefined && value !== variable ) {
			scriptletContext.putGlobal(name,value)
		}
	});
}

try {
	switch(action) {
		case "ORDER":
		case "MODIFY_SUBSCRIPTION":
		case "OTHER":
		scriptletResponse = action;
		break;

		default:	
		throw new Error("Action unknown: " + action);
	}
}
catch(error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",error);
}

if(approvalResult === "Approved") {
	scriptletResponse = approvalResult;
}
else if(approvalResult === "Rejected") {
	scriptletResponse = approvalResult;
}
else {
	scriptletContext.put("approvalResult", null);
	scriptletContext.put("reason", null);
	scriptletContext.put("password", null);
	scriptletResponse = "Ignored";	
}
